import React from "react";
import "./ToMesh.css";
import { BrowserView, MobileOnlyView } from "react-device-detect";
import Desktop_Title from "modules/toMesh/components/desktopTitle";
import Header from "modules/toMesh/components/pbTitle";

const ToMesh = () => {
  let content = <Desktop_Title />;
  return (
    <>
      <Header></Header>
      <BrowserView>{content}</BrowserView>
      <MobileOnlyView></MobileOnlyView>
    </>
  );
};

export default ToMesh;
